value:
Pass a workload definition. This is a file containing a JSON dictionary. The keys are root functions, the values are lists of functions to import in the module defining the root. It is assumed -funique-internal-linkage-names was used, to ensure local linkage functions have unique names. For example: 
{
  "rootFunction_1": ["function_to_import_1", "function_to_import_2"], 
  "rootFunction_2": ["function_to_import_3", "function_to_import_4"] 
}
